CREATE DEFINER=`root`@`localhost` PROCEDURE `getRankingTable`()
BEGIN

	SELECT c.name AS clubname, c.leagueID as leagueID, SUM(if(c.id = m.awayTeamID AND m.awayScore > m.homeScore,1,0)) + SUM(if(c.id = m.homeTeamID AND m.homeScore > m.awayScore,1,0)) AS win, SUM(IF(m.awayScore = m.homeScore,1,0)) AS due, 
    SUM(if(c.id = m.awayTeamID AND m.awayScore < m.homeScore,1,0)) + SUM(if(c.id = m.homeTeamID AND m.homeScore < m.awayScore,1,0)) AS lose
	FROM Club c
	INNER JOIN `Match` m ON (c.id = m.homeTeamID OR c.id = m.awayTeamID)
	GROUP BY c.id
	ORDER BY c.leagueID, win DESC, due DESC;

END ;;
