CREATE DEFINER=`root`@`localhost` PROCEDURE `getTop10PlayerRating`()
BEGIN
SELECT (COUNT(*)) as Matches, p.`name`, c.`name` as clubName, (SUM(pms.rating)/COUNT(*)) as AvgRatings
FROM PlayerMatchStatistic pms, Player p, Club c 
WHERE rating > 0 and pms.playerID = p.id and p.currentTeamID = c.id
GROUP BY playerID
ORDER BY AvgRatings DESC LIMIT 10;
END ;;
